import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'food-app';
}
<!-- <app-header></app-header> -->
<header>
  <div class="container">
    <a href="#" routerLink="/" class="logo">Food Mine!</a>
    <nav>
      <ul>
        <li>
          <a href="#" routerLink="/cart-page">Cart</a>
        </li>
      </ul>
    </nav>
  </div>
</header>
